import React, { Component } from "react";
import { Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import Login from "./components/login";
import AddTutorial from "./components/add-cliente.component";
import TutorialsList from "./components/clientes-list.component";
import Tutorial from "./components/cliente.component";

class App extends Component {
  render() {
    //<Link to={"/tutorials"} className="nav-link">
    //  Tutorials
    //</Link>
    //<Link to={"/add"} className="nav-link">
    //  Add
    //</Link>

    return (
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-success">
          <Link to={"/"} className="navbar-brand">
          <img src="../../logo_pefoce.svg" alt="PEFOCE" width="100%"></img>
          </Link>
          <div className="navbar-nav mr-auto">
            <li className="nav-item">
              <div id="tagLinkTutorials"></div>
            </li>
            <li className="nav-item">
              <div id="tagLinkAdd"></div>
            </li>
          </div>
        </nav>

        <div className="container mt-3">
          <Routes>
            <Route path="/" element={<Login/>} />
            <Route path="/tutorials" element={<TutorialsList/>} />
            <Route path="/add" element={<AddTutorial/>} />
            <Route path="/tutorials/:id" element={<Tutorial/>} />
          </Routes>
        </div>
      </div>
    );
  }
}

export default App;
